    public struct spectrumMaskResult
    {
        public float[] MaskLevels_dB;
        public double[] MaskFrequencies_kHz;
    }

    public static class CreateMaskFromSpectrum
    {
        public static T[] SubArray<T>(this T[] data, int index, int length)
        {
            T[] result = new T[length];
            Array.Copy(data, index, result, 0, length);
            return result;
        }

        /// <summary>
        /// Creates mask from smoothed Emitting spectrum
        /// </summary>
        /// <param name="spectrumLevels_dBm">Levels of Emitting spectum</param>
        /// <param name="spectrumStartFreq_MHz">Start frequency of Emitting spectrum</param>
        /// <param name="spectrumSteps_kHz">Step between frequencies of Emitting spectrum</param>
        /// <param name="maskMargin_dB">Level at which mask should exceed maximum power of emitting</param>
        /// <param name="initialCutoff_dB">Level at whish estimated in-block limit (recommended 6 .. 15 dB)</param>
        /// <param name="numberOfMask_pt">Numper of point in the mask. Should be even, from 6 to 18 points</param>
        /// <returns></returns>
        public static spectrumMaskResult CreateMaskFromEmitting(float[] spectrumLevels_dBm, double spectrumStartFreq_MHz, double spectrumSteps_kHz, float maskMargin_dB, float initialCutoff_dB, int numberOfMask_pt)
        {

            if (numberOfMask_pt % 2 != 0 || numberOfMask_pt < 6)
            {
                throw new InvalidOperationException("Spectrum mask should have at least 6 points. Numbet of points should be even");
            }

            spectrumMaskResult resultMask;
            
            int minBeforeMaxIndex = 0;
            int mediumBeforeCutoffIndex = 0;

            int cutoffBeforeMaxIndex = 0;
            int cutoffAfterMaxIndex = 0;

            int mediumAfterCutoffIndex = 0;
            int minAfterMaxIndex = 0;

            float minBeforeMax = 0.0f;
            float minAfterMax = 0.0f;

            float MaxLevel_Dbm = spectrumLevels_dBm.Max();
            bool WasMax = false;
            bool WasFirstCutoff = false;

            resultMask.MaskLevels_dB = new float[numberOfMask_pt];
            resultMask.MaskFrequencies_kHz = new double[numberOfMask_pt];
            //  Searching for intersection of cutoff level with emitting spectrum and spectrum minimums
            for (int i = 0; i < spectrumLevels_dBm.Length; i++)
            {
                if (spectrumLevels_dBm[i] == MaxLevel_Dbm) WasMax = true;
                if (!(WasMax && WasFirstCutoff))
                {
                    if (spectrumLevels_dBm[i] < minBeforeMax)
                    {
                        minBeforeMax = spectrumLevels_dBm[i];
                        minBeforeMaxIndex = i;
                    }
                    if ((spectrumLevels_dBm[i] > (MaxLevel_Dbm - initialCutoff_dB)) && !WasFirstCutoff )
                    {
                        cutoffBeforeMaxIndex = i;
                        WasFirstCutoff = true;
                    }
                }
                else
                {
                    if (spectrumLevels_dBm[i] > (MaxLevel_Dbm - initialCutoff_dB))
                    {
                        cutoffAfterMaxIndex = i;
                    }
                    if (spectrumLevels_dBm[i] < minAfterMax)
                    {
                        minAfterMax = spectrumLevels_dBm[i];
                        minAfterMaxIndex = i;
                    }
                }
            }

            // First 6 points of mask are found
            int mediumExtension = (Math.Max(cutoffBeforeMaxIndex, spectrumLevels_dBm.Length - cutoffAfterMaxIndex) / (numberOfMask_pt - 2));
            resultMask.MaskLevels_dB[0] = spectrumLevels_dBm[minBeforeMaxIndex] + maskMargin_dB;
            resultMask.MaskFrequencies_kHz[0] = spectrumStartFreq_MHz * 1000 + spectrumSteps_kHz * minBeforeMaxIndex;
            resultMask.MaskLevels_dB[1] = (spectrumLevels_dBm.SubArray(minBeforeMaxIndex, mediumExtension)).Max() + maskMargin_dB;
            resultMask.MaskFrequencies_kHz[1] = spectrumStartFreq_MHz * 1000 + spectrumSteps_kHz * minBeforeMaxIndex;

            float cutoffLevel_dBm = Math.Max(spectrumLevels_dBm[cutoffBeforeMaxIndex], spectrumLevels_dBm[cutoffAfterMaxIndex]);
            resultMask.MaskLevels_dB[(numberOfMask_pt / 2) - 1] = cutoffLevel_dBm + initialCutoff_dB + maskMargin_dB;
            resultMask.MaskFrequencies_kHz[(numberOfMask_pt / 2) - 1] = spectrumStartFreq_MHz * 1000 + spectrumSteps_kHz * cutoffBeforeMaxIndex;
            resultMask.MaskLevels_dB[(numberOfMask_pt / 2)] = cutoffLevel_dBm + initialCutoff_dB + maskMargin_dB;
            resultMask.MaskFrequencies_kHz[(numberOfMask_pt / 2)] = spectrumStartFreq_MHz * 1000 + spectrumSteps_kHz * cutoffAfterMaxIndex;

            resultMask.MaskLevels_dB[numberOfMask_pt - 2] = (spectrumLevels_dBm.SubArray(minAfterMaxIndex - mediumExtension, mediumExtension)).Max() + maskMargin_dB;
            resultMask.MaskFrequencies_kHz[numberOfMask_pt - 2] = spectrumStartFreq_MHz * 1000 + spectrumSteps_kHz * minAfterMaxIndex;

            resultMask.MaskLevels_dB[numberOfMask_pt - 1] = spectrumLevels_dBm[minAfterMaxIndex] + maskMargin_dB;
            resultMask.MaskFrequencies_kHz[numberOfMask_pt - 1] = spectrumStartFreq_MHz * 1000 + spectrumSteps_kHz * minAfterMaxIndex;

            // If mask should have more than 6 ppoints - transition band divided into equel parts and covers spectrum of emitting
            if (numberOfMask_pt >= 8)
            {
                for(int i = 2; i < (numberOfMask_pt / 2) - 1; i++)
                {
                    mediumBeforeCutoffIndex = ((i - 1) * (cutoffBeforeMaxIndex - minBeforeMaxIndex) / ((numberOfMask_pt) / 2 - 2));
                    resultMask.MaskLevels_dB[i] = (spectrumLevels_dBm.SubArray(mediumBeforeCutoffIndex - mediumExtension, mediumExtension * 2)).Max() + maskMargin_dB;
                    resultMask.MaskFrequencies_kHz[i] = spectrumStartFreq_MHz * 1000 + spectrumSteps_kHz * mediumBeforeCutoffIndex;

                    mediumAfterCutoffIndex = cutoffAfterMaxIndex + ((i - 1) * (minAfterMaxIndex - cutoffAfterMaxIndex) / ((numberOfMask_pt) / 2 - 2));
                    resultMask.MaskLevels_dB[(i + numberOfMask_pt / 2) - 1] = (spectrumLevels_dBm.SubArray(mediumAfterCutoffIndex - mediumExtension, 2 * mediumExtension)).Max() + maskMargin_dB;
                    resultMask.MaskFrequencies_kHz[(i + numberOfMask_pt / 2) - 1] = spectrumStartFreq_MHz * 1000 + spectrumSteps_kHz * mediumAfterCutoffIndex;
                }
            }

            return resultMask;

        }

